import { Container, Navbar, Nav } from "react-bootstrap";
import logo from './logo.png';
import { Component } from "react";
export default class Header extends Component {
    render() {
        return (
            <>
                <Navbar style={{ height: '100px', backgroundColor: '#BE95C4', boxShadow: '0px 1px 0px', zIndex: "1" }}>
                    <Container bg="#BE95C4">
                        <Navbar.Brand href="/" style={{ position: 'absolute', top: 0, left: 0 }}>
                            <img
                                src={logo}
                                height="100%"
                                className="d-inline-block align-top"
                                alt="logo"
                                style={{ left: "0" }}
                            />
                        </Navbar.Brand>
                        <Nav className="d-inline-block align-top" style={{right: "0"}}>
                            <Nav.Link href="/"> Telegram </Nav.Link>
                            <Nav.Link href="/"> Set Notifications </Nav.Link>
                        </Nav>
                    </Container>
                </Navbar>
            </>
        )
    }
}
